import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const StudentDashboard = () => {
  const [student, setStudent] = useState(null);
  const [form, setForm] = useState({ name: '', email: '', course: '' });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) return navigate('/login');
    fetchProfile();
    // eslint-disable-next-line
  }, []);

  const fetchProfile = async () => {
    setLoading(true);
    try {
      const res = await axios.get('http://localhost:5000/api/students/me', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setStudent(res.data);
      setForm({
        name: res.data?.user?.name || '',
        email: res.data?.user?.email || '',
        course: res.data?.course || '',
      });
    } catch (err) {
      console.error(err);
      setError('Failed to fetch profile. Please login again.');
      localStorage.removeItem('token');
      localStorage.removeItem('role');
      navigate('/login');
    } finally {
      setLoading(false);
    }
  };

  const onChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
    setError('');
    setSuccess('');
  };

  const onSubmit = async e => {
    e.preventDefault();
    try {
      await axios.put('http://localhost:5000/api/students/me', form, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setSuccess('Profile updated successfully');
      fetchProfile();
    } catch (err) {
      console.error(err);
      setError('Failed to update profile');
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('role');
    navigate('/login');
  };

  if (loading) return <p style={{ textAlign: 'center' }}>Loading profile...</p>;
  if (!student) return <p style={{ textAlign: 'center' }}>No profile data</p>;

  return (
    <div className="student-dashboard">
      <h2>Student Dashboard</h2>
      {error && <p style={{ color: 'red', textAlign: 'center' }}>{error}</p>}
      {success && <p style={{ color: 'green', textAlign: 'center' }}>{success}</p>}

      <div className="profile-info">
        <p><strong>Name:</strong> {student?.user?.name}</p>
        <p><strong>Email:</strong> {student?.user?.email}</p>
        <p><strong>Course:</strong> {student?.course}</p>
        <p><strong>Enrollment Date:</strong> {student?.enrollmentDate ? new Date(student.enrollmentDate).toLocaleDateString() : ''}</p>
      </div>

      <form onSubmit={onSubmit}>
        <input type="text" name="name" value={form.name} onChange={onChange} required />
        <input type="email" name="email" value={form.email} onChange={onChange} required />
        <input type="text" name="course" value={form.course} onChange={onChange} required />
        <button type="submit">Update Profile</button>
      </form>

      <button onClick={logout} style={{ marginTop: '20px' }}>Logout</button>
    </div>
  );
};

export default StudentDashboard;
